import React from "react";
import { Link } from "react-router-dom";



import NotFoundBlock from "../../../components/NotFoundBlock/NotFoundBlock";

const NotFound = () => {
  return (
    <>
      <NotFoundBlock />
      <Link to={"/"}>
        <div className="btnw btn_bg_none">
          <p>Вернуться назад</p>
        </div>
      </Link>
    </>
  );
};

export default NotFound;
